window.bookSummaryJSON = "<p>\"You're in our world now, Princess. You're ours.\"</p> <p>My whole life, I’ve been groomed as American royalty, raised to be the perfect daughter of the wealthy elite.</p> <p>On my 16th birthday, my father bought me an Aston Martin.</p> <p>And on my 17th birthday, the Feds took everything away.</p> <p>With my father in prison for fraud and nothing left to our name, my mom and I are forced to move to a tiny house across town, and I transfer to Slateview Public.</p> <p>The only problem is, nearly everyone at my new school has reason to despise my family name. They want to see a princess brought low, and they’ll do whatever it takes to make me fall.</p> <p>Money was the language of my old world, but violence is the language of my new one. The only way I’ll survive until graduation is to make a deal with three gorgeous, dangerous devils - the ones everyone calls the Lost Boys.</p> <p>If I accept their bargain, Bishop, Misael, and Kace will protect me.</p> <p>But they’ll own me too.</p> <p>This is the first book in the Slateview High series, a reverse harem bully romance. It contains steamy scenes and dark subject matter.</p>"; 
